"use client";

import React, { useState } from "react";
import axios from "axios";

interface PayrollDetails {
  income_type?: string;
  annual_salary?: number;
  hourly_rate?: number;
  first_name?: string;
  last_name?: string;
  middle_name?: string;
  average_hours_per_week?: number;
  seasonal_variation?: string;
  estimated_annual_income?: number;
  filing_status?: string;
  pay_frequency?: string;
  current_withholding_per_paycheck?: number;
  desired_boost_per_paycheck?: number | null;
  additional_income?: number;
  deductions?: number;
  dependents?: number;
  spouse_income?: number;
}

interface UserAndSessionId {
  payroll_details: PayrollDetails;
  company_name: string;
  first_name: string;
  last_name: string;
  email: string;
}

interface TokenPayload {
  client_id: string;
  client_secret: string;
}

// Store token in localStorage
const tokenStore = (data: any) => {
  localStorage.setItem("authTokenMuse", data.access_token);
  localStorage.setItem("refreshTokenMuse", data.refresh_token);
};

// Create token from client ID & secret
const tokenCreateFromClientIdAndSecret = async (payload: TokenPayload) => {
  try {
    const response = await axios.post(
      `https://api-stgbe.musetax.com/auth/token`,
      payload
    );
    tokenStore(response.data);
    return response.data;
  } catch (error: any) {
    console.error(error);
    throw new Error("Failed to create token");
  }
};

// Store session ID with 1-day expiry
const storeSessionId = (session_id: string) => {
  const ONE_DAY_MS = 24 * 60 * 60 * 1000;
  localStorage.setItem("originalSessionId", session_id);
  localStorage.setItem(
    "sessionExpiry",
    (Date.now() + ONE_DAY_MS).toString()
  );
};

// Get session ID if valid
const getSessionId = (): string | null => {
  const expiryStr = localStorage.getItem("sessionExpiry");
  const sessionId = localStorage.getItem("originalSessionId");

  if (!expiryStr || !sessionId) return null;

  if (Date.now() > parseInt(expiryStr, 10)) return null;

  return sessionId;
};

// API call to get session ID
const getUserAndSessionId = async (payload: UserAndSessionId) => {
  try {
    const response = await axios.post(
      `https://api-stgbe.musetax.com/auth/token`,
      payload
    );
    storeSessionId(response.data.session_id);
    return response.data;
  } catch (error: any) {
    console.error(error);
    throw new Error("Failed to get session id");
  }
};

export default function AuthForm() {
  const [formData, setFormData] = useState({
    client_id: "",
    client_secret: "",
    company_name: "",
    first_name: "",
    last_name: "",
    email: "",
    chattype: "ukg-ready",
    income_type: "",
    annual_salary: 0,
    hourly_rate: 0,
    average_hours_per_week: 0,
    filing_status: "",
    pay_frequency: "",
    current_withholding_per_paycheck: 0,
    desired_boost_per_paycheck: 0,
    additional_income: 0,
    deductions: 0,
    dependents: 0,
    spouse_income: 0,
  });

  const [showIframe, setShowIframe] = useState(false);
  const [iframeUrl, setIframeUrl] = useState("");

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async () => {
    try {
      // 1Ô∏è‚É£ Get token
      const tokenData = await tokenCreateFromClientIdAndSecret({
        client_id: formData.client_id,
        client_secret: formData.client_secret,
      });

      // 2Ô∏è‚É£ Get session ID
      const sessionData = await getUserAndSessionId({
        company_name: formData.company_name,
        first_name: formData.first_name,
        last_name: formData.last_name,
        email: formData.email,
        payroll_details: {
          income_type: formData.income_type,
          annual_salary: Number(formData.annual_salary),
          hourly_rate: Number(formData.hourly_rate),
          average_hours_per_week: Number(formData.average_hours_per_week),
          filing_status: formData.filing_status,
          pay_frequency: formData.pay_frequency,
          current_withholding_per_paycheck: Number(
            formData.current_withholding_per_paycheck
          ),
          desired_boost_per_paycheck: Number(formData.desired_boost_per_paycheck),
          additional_income: Number(formData.additional_income),
          deductions: Number(formData.deductions),
          dependents: Number(formData.dependents),
          spouse_income: Number(formData.spouse_income),
        },
      });

      // 3Ô∏è‚É£ Open iframe with all data as query params
      const url = new URL("http://localhost:3000/");
      url.searchParams.append("chattype", formData.chattype);
      url.searchParams.append("user_id", sessionData.user_id);
      url.searchParams.append("session_id", sessionData.session_id);
      url.searchParams.append("access_token", tokenData.access_token);
      url.searchParams.append("refresh_token", tokenData.refresh_token);

      setIframeUrl(url.toString());
      setShowIframe(true);
    } catch (error) {
      console.error("Error submitting form:", error);
    }
  };

  return (
    <div className="p-4 space-y-4">
      <h2 className="text-xl font-bold">Auth & Payroll Form</h2>

      {/* Client ID & Secret */}
      <input
        type="text"
        name="client_id"
        placeholder="Client ID"
        value={formData.client_id}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      <input
        type="text"
        name="client_secret"
        placeholder="Client Secret"
        value={formData.client_secret}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />

      {/* Company & User Info */}
      <input
        type="text"
        name="company_name"
        placeholder="Company Name"
        value={formData.company_name}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      <input
        type="text"
        name="first_name"
        placeholder="First Name"
        value={formData.first_name}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      <input
        type="text"
        name="last_name"
        placeholder="Last Name"
        value={formData.last_name}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      <input
        type="email"
        name="email"
        placeholder="Email"
        value={formData.email}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />

      {/* Payroll Details (optional) */}
      <input
        type="text"
        name="income_type"
        placeholder="Income Type"
        value={formData.income_type}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      <input
        type="number"
        name="annual_salary"
        placeholder="Annual Salary"
        value={formData.annual_salary}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      <input
        type="number"
        name="hourly_rate"
        placeholder="Hourly Rate"
        value={formData.hourly_rate}
        onChange={handleChange}
        className="border p-2 rounded w-full"
      />
      {/* ... add more fields similarly if needed ... */}

      <button
        onClick={handleSubmit}
        className="px-4 py-2 bg-blue-500 text-white rounded"
      >
        Open Iframe
      </button>

      {showIframe && iframeUrl && (
        <iframe
          src={iframeUrl}
          width="1000"
          height="1000"
          style={{ border: "none", overflow: "hidden" }}
          allow="clipboard-write; microphone; camera"
          title="My Iframe"
        />
      )}
    </div>
  );
}
